    y_data_h = convert_to_float(data_h)  # EPDS 2 Demand (Column H)
    y_data_i = convert_to_float(data_i)  # EPDS 3 Demand (Column I)
    y_data_bd = convert_to_float(data_bd)  # Production Rate To Red (Column BD)
    y_data_bt = convert_to_float(data_bt)  # Production Rate To RM (Column BT)

    # Ensure all data lengths match
    lengths = [
        len(x_data_time),
        len(y_data_g),
        len(y_data_h),
        len(y_data_i),
        len(y_data_bd),
        len(y_data_bt),
    ]
    max_length = max(lengths)

    # Pad lists to match the maximum length
    def pad_list(data_list, target_length):
        return data_list + [np.nan] * (target_length - len(data_list))

    x_data_time = pad_list(x_data_time, max_length)
    y_data_g = pad_list(y_data_g, max_length)
    y_data_h = pad_list(y_data_h, max_length)
    y_data_i = pad_list(y_data_i, max_length)
    y_data_bd = pad_list(y_data_bd, max_length)
    y_data_bt = pad_list(y_data_bt, max_length)

    return x_data_time, y_data_g, y_data_h, y_data_i, y_data_bd, y_data_bt


