    # Function to convert multiline string data into lists of floats
    def convert_to_float(data_string):
        return [
            float(value.strip().replace(",", ""))
            for value in data_string.splitlines()
            if value.strip()
        ]

    #     return new_time_series
    def process_time_series(x_data_time, base_date):
        datetime_data = []

        # Initialize a variable to store the previous time as a timedelta
        previous_time = timedelta(hours=0, minutes=0, seconds=0)

        for time_str in x_data_time:
            # Convert the time string to a timedelta
            time_parts = time_str.split(":")
            if len(time_parts) == 3:
                current_time = timedelta(
                    hours=int(time_parts[0]),
                    minutes=int(time_parts[1]),
                    seconds=int(time_parts[2]),
                )

                # Check if the current time is less than the previous time (indicates a new day)
                if current_time < previous_time:
                    base_date += timedelta(
                        days=1
                    )  # Increment the base date for a new day

                # Calculate the current datetime
                current_datetime = base_date + current_time
                datetime_data.append(current_datetime)

                # Update previous_time for the next iteration
                previous_time = current_time

        return datetime_data

    base_date = pd.Timestamp("2024-09-05")  # Set the base date here

    # Extracting data
    x_data_time = process_time_series(
        data_x.splitlines(), base_date
    )  # x-axis time values
    y_data_rm_tp_added = convert_to_float(data_bb)  # RM TP added
    y_data_nn_added = convert_to_float(
        data_as
    )  # NN added (using the same data for demonstration)
    y_data_ne_added = convert_to_float(data_at)  # NE added
    y_data_nw_added = convert_to_float(data_ar)  # NW added
    y_data_v_added = convert_to_float(data_aq)  # V added
    y_data_ne_treatment_added = convert_to_float(data_av)  # NE TREATMENT ADDED
    y_data_s_added = convert_to_float(data_ap)  # s added
    y_data_ne_nn_treatment_added = convert_to_float(data_aw)  # NE + NN TREATMENT ADDED
    y_data_glennwilde_added = convert_to_float(data_au)  # Glennwilde added

    # Ensure all data lengths match
    lengths = [
        len(x_data_time),
        len(y_data_rm_tp_added),
        len(y_data_nn_added),
        len(y_data_ne_added),
        len(y_data_nw_added),
        len(y_data_v_added),
        len(y_data_ne_treatment_added),
        len(y_data_s_added),
        len(y_data_ne_nn_treatment_added),
        len(y_data_glennwilde_added),
    ]
    max_length = max(lengths)

    # Pad lists to match the maximum length
    def pad_list(data_list, target_length):
        return data_list + [np.nan] * (target_length - len(data_list))

    x_data_time = pad_list(x_data_time, max_length)
    y_data_rm_tp_added = pad_list(y_data_rm_tp_added, max_length)
    y_data_nn_added = pad_list(y_data_nn_added, max_length)
    y_data_ne_added = pad_list(y_data_ne_added, max_length)
    y_data_nw_added = pad_list(y_data_nw_added, max_length)
    y_data_v_added = pad_list(y_data_v_added, max_length)
    y_data_ne_treatment_added = pad_list(y_data_ne_treatment_added, max_length)
    y_data_s_added = pad_list(y_data_s_added, max_length)
    y_data_ne_nn_treatment_added = pad_list(y_data_ne_nn_treatment_added, max_length)
    y_data_glennwilde_added = pad_list(y_data_glennwilde_added, max_length)

    return (
        x_data_time,
        y_data_rm_tp_added,
        y_data_nn_added,
        y_data_ne_added,
        y_data_nw_added,
        y_data_v_added,
        y_data_ne_treatment_added,
        y_data_s_added,
        y_data_ne_nn_treatment_added,
        y_data_glennwilde_added,
    )


