    y_data_as = convert_to_float(data_be)  # resultant AS
    y_data_no3 = convert_to_float(data_bf)  # resultant NO3
    y_data_f = convert_to_float(data_bg)  # resultant F
    y_data_u = convert_to_float(data_bh)  # resultant U
    y_data_tds = convert_to_float(data_bi)  # resultant TDS

    # Ensure all data lengths match
    lengths = [
        len(x_data_time),
        len(y_data_as),
        len(y_data_no3),
        len(y_data_f),
        len(y_data_u),
        len(y_data_tds),
    ]
    max_length = max(lengths)

    # Pad lists to match the maximum length
    def pad_list(data_list, target_length):
        return data_list + [np.nan] * (target_length - len(data_list))

    x_data_time = pad_list(x_data_time, max_length)
    y_data_as = pad_list(y_data_as, max_length)
    y_data_no3 = pad_list(y_data_no3, max_length)
    y_data_f = pad_list(y_data_f, max_length)
    y_data_u = pad_list(y_data_u, max_length)
    y_data_tds = pad_list(y_data_tds, max_length)

    return x_data_time, y_data_as, y_data_no3, y_data_f, y_data_u, y_data_tds
